import React, { useState } from 'react';
import {Route, BrowserRouter} from 'react-router-dom';
import firebase from 'firebase';
import Login from './components/Login';
import Signup from './components/Signup';
import Logout from './components/Logout';
import Trips from './components/Trips';
import Weather from './components/Weather';
import TireMain from './components/TireMain';
import NavBar from './components/NavBar';

import './App.css';

function App() {

    var firebaseConfig = {
        apiKey: "AIzaSyDEbzt9TfJJZZxuZsH_qXv3eeb5g62GgmE",
        authDomain: "my-finalproject-2b552.firebaseapp.com",
        projectId: "my-finalproject-2b552",
        storageBucket: "my-finalproject-2b552.appspot.com",
        messagingSenderId: "512038742459",
        appId: "1:512038742459:web:cd68f269818ae75585bc9e",
        measurementId: "G-LZBJTEXX4X"
      };
      // Initialize Firebase
      firebase.initializeApp(firebaseConfig);

  return (

      <BrowserRouter>
          <NavBar />
          <Route path="/login">
              <Login />
          </Route>
          <Route path="/logout">
              <Logout />
          </Route>
          <Route path="/trips">
              <Trips />
          </Route>
          <Route path="/signup">
              <Signup />
          </Route>
          <Route path="/TireMain">
              <TireMain />
          </Route>
          <Route path="/Weather">
              <Weather />
          </Route>


      </BrowserRouter>
  )

}

export default App;
